import React from 'react';
import './App.css';
import Loginpage from "./loginpage";
import Homepage from "./homepage";





function App(this: any) {
    let ableToLogin = false

    if (ableToLogin) {
        return (
            <Homepage/>
        );
    } else {
        this.ableToLogin = true
        return (
            <Loginpage/>
            );
    }

}

export default App;
